waves.point_eqs_str:
tm = q1;
sp = sample*6.28*8*6;

vol = (value1+value2)*.5;
it = it*above(sample,0);
it = it + 1;
rad = .5 + vol + .02;
ra = rad*sin(sample*3.14);
ox = ra*sin(sp);
oy = sin(sample*3.14-1.57)*rad;
oz = ra*cos(sp);

xang = tm*.132;
sxang = 0;
yang = tm*.153;
ayang = 0;
zang = tm*.110;
azang = 0;
fov = 0.6 + 0.2*sin(tm);
fov = .5;

mx = ox*cos(zang) - oy*sin(zang);
my = ox*sin(zang) + oy*cos(zang);
ox = mx;
oy = my;
mx = ox*cos(yang) + oz*sin(yang);
mz = - ox*sin(yang) + oz*cos(yang);
ox = mx;
oz = mz;
my = oy*cos(xang) - oz*sin(xang);
mz = oy*sin(xang) + oz*cos(xang);
oy = my;
oz = mz;

oz = oz - 2;
x = ox*fov/oz + 0.5;
x = (x-.5)*0.75 + 0.5;
y = oy*fov/oz + 0.5;

r = 1;
g = .25+.25*sin(sp);
b = 0;
a = .5 + (oz+2)*.5;
a = a*below(z,2);
minrgb = min(r,min(g,b));
maxrgb = max(r,max(g,b));
l = (maxrgb-minrgb)*.5;
diff = maxrgb-minrgb;
sum = maxrgb+minrgb;
s = if(above(l,0.5),diff/(2-sum),diff/sum)*(1-equal(l,0));
